    // \u4E1A\u52A1\u903B\u8F91\u5904\u7406 \uFF08\u53EA\u4E3A\u6D4B\u8BD5\u7528\u8FD4\u56DE\u539F\u6765\u7684\u6570\u636E\uFF09
    WriteLog( "\u6536\u5230\u5BA2\u6237\u6570\u636E:[%s]", szReadBuf);
